        //テキスト ファイル選択後の操作
        private void openFileDialog1_FileOk(object sender, CancelEventArgs e)
        {
            IWorkspaceFactory pWorkspaceFactory = null;
            IFeatureWorkspace pFeatureWorkspcae = null;

            try
            {
                //初期化
                textBoxParameter1.Text = m_openFileDialog1.FileName;
                comboBoxParameter2.Items.Clear();
                comboBoxParameter3.Items.Clear();

                //テーブルのフルパスからフィールドを取得
                System.IO.FileInfo cFileInfo = new System.IO.FileInfo(m_openFileDialog1.FileName);

                pWorkspaceFactory = SingletonUtility.NewTextFileWorkspaceFactory(); //new TextFileWorkspaceFactoryClass();
                pFeatureWorkspcae = (IFeatureWorkspace)pWorkspaceFactory.OpenFromFile(cFileInfo.DirectoryName, 0);
                ITable pTable = pFeatureWorkspcae.OpenTable(cFileInfo.Name);
                m_pTable = pTable;

                IFields pFields = pTable.Fields;
                IField pField;
                for (int i = 0; i <= pFields.FieldCount - 1; ++i)
                {
                    pField = pFields.get_Field(i);
                    if (pField.Type == esriFieldType.esriFieldTypeDouble |
                       pField.Type == esriFieldType.esriFieldTypeInteger |
                       pField.Type == esriFieldType.esriFieldTypeSingle |
                       pField.Type == esriFieldType.esriFieldTypeSmallInteger)
                    {
                        FieldComboItem comboboxField = new FieldComboItem(pField);
                        comboBoxParameter2.Items.Add(comboboxField);
                        comboBoxParameter3.Items.Add(comboboxField);
                    }
                }

                //読み込んだテーブル内に、X、Y、を判断して適切に表示
                int indexX = comboBoxParameter2.FindString("X");
                int indexY = comboBoxParameter2.FindString("Y");

                comboBoxParameter2.SelectedIndex = indexX;
                comboBoxParameter3.SelectedIndex = indexY;

            }
            catch (Exception ex)
            {
                MessageBox.Show(ex.Message, "エラー", MessageBoxButtons.OK, MessageBoxIcon.Error);

            }
            finally
            {
                //ComReleaser.ReleaseCOMObject(pWorkspaceFactory);
                ComReleaser.ReleaseCOMObject(pFeatureWorkspcae);
            }
        }


