        /// <summary>
        /// ジオプロセシング ツール実行前のパラメータ チェック
        /// </summary>
        /// <returns></returns>
        private bool checkParameter()
        {
            string errorStrings = "";

            if (this.textBoxParameter1.Text == "")
            {
                errorStrings += "・XY テーブルが選択されていません。" + Environment.NewLine;
            }

            if (this.comboBoxParameter2.SelectedIndex == -1)
            {
                errorStrings += "・X フィールドが選択されていません。" + Environment.NewLine;
            }

            if (this.comboBoxParameter3.SelectedIndex == -1)
            {
                errorStrings += "・Y フィールドが選択されていません。" + Environment.NewLine;
            }

            if (treeViewParameter5.SelectedNode.Tag.ToString() != "Selectable")
            {
                errorStrings += "・座標系が選択されていません。" + Environment.NewLine;
            }

            if (this.textBoxParameter61.Text == "")
            {
                errorStrings += "・出力ワークスペースが選択されていません。" + Environment.NewLine;
            }

            if (this.textBoxParameter62.Text == "")
            {
                errorStrings += "・出力フィーチャクラス名が入力されていません。" + Environment.NewLine;
            }

            // 2012/08/27 ADD
            if (errorStrings != "")
            {
                MessageBox.Show(errorStrings, "パラメータ チェック エラー", MessageBoxButtons.OK, MessageBoxIcon.Error);
                return false;
            }
            // 2012/08/27 ADD

            //※フィーチャクラス名のバリデートを追加
            errorStrings += Check.FeatureClassString(this.textBoxParameter61.Text, this.textBoxParameter62.Text, checkBoxOverwrite.Checked);

            if (errorStrings != "")
            {
                MessageBox.Show(errorStrings, "パラメータ チェック エラー", MessageBoxButtons.OK, MessageBoxIcon.Error);
                return false;
            }
            else
            {
                return true;
            }

        }

