        /// <summary>
        /// 処理実行
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>            //パラメータ チェック
        private void okButton_Click(object sender, EventArgs e)
        {
            if (!checkParameter())
            {
                return;
            }

            // 2012/08/17 ADD
            // オプション設定よりバックグラウンド実行設定を取得
            try
            {
                m_execBackground = (settingFile.GeoprocessingBackground == "1");
            }
            catch (Exception ex)
            {
                MessageBoxManager.ShowMessageBoxError(this,
                    Properties.Resources.CommonMessage_OptionSetting_ERROR_ValueCantRead
                    + "[ " + FIELD_NAME_BACKGROUND + " ]"

                    + Properties.Resources.CommonMessage_OptionSetting_ERROR_ResetMessage);
                Common.Logger.Error(
                    Properties.Resources.CommonMessage_OptionSetting_ERROR_ValueCantRead
                    + "[ " + FIELD_NAME_BACKGROUND + " ]"
                    + Properties.Resources.CommonMessage_OptionSetting_ERROR_ResetMessage);
                
                Common.Logger.Error(ex.Message);
                Common.Logger.Error(ex.StackTrace);

                // 読み込めない場合でも、処理の継続をする（フォアグラウンド実行）
            }
            // 2012/08/17 ADD

            //フィールド
            FieldComboItem comboFieldX = (FieldComboItem)comboBoxParameter2.SelectedItem;
            FieldComboItem comboFieldY = (FieldComboItem)comboBoxParameter3.SelectedItem;

            //パラメータ セット
            string table = textBoxParameter1.Text;
            string in_x_field = comboFieldX.FieldName;
            string in_y_field = comboFieldY.FieldName;
            string spatial_reference = treeViewParameter5.SelectedNode.Name;
            string out_path = textBoxParameter61.Text;
            string out_name = textBoxParameter62.Text;

            // Unknownのときに文字列でUnknownを設定するとエラーのため
            // デフォルト指定するように変更
            if (spatial_reference.ToUpper().Equals("UNKNOWN"))
            {
                spatial_reference = "#";
            }

            IVariantArray pVariantArray = new VarArrayClass();
            pVariantArray.Add(table);
            pVariantArray.Add(in_x_field);
            pVariantArray.Add(in_y_field);
            pVariantArray.Add(spatial_reference);
            pVariantArray.Add(out_path);
            pVariantArray.Add(out_name);
            pVariantArray.Add("");

            //ジオプロセシング処理
            this.Visible = false;
            FormExecuteGP frm = new FormExecuteGP(this.Owner, m_pMapControl.Map);
            frm.Execute("CreateXY_gislight", pVariantArray, checkBoxAddMap.Checked, m_execBackground, checkBoxOverwrite.Checked, m_CustomToolboxPath);

        }

